def get_temp(month):
    ret = {"month": [], "day": [], "hour": [], "temp": []}
    for d in month:
        date = datetime.utcfromtimestamp(d["date"]/1000)
        ret["month"].append(date.strftime("%m"))
        ret["day"].append(date.strftime("%d"))
        ret["hour"].append(date.strftime("%H"))
        try:
            ret["temp"].append(d["temp"])
        except:
            ret["temp"].append(-99)
    return pd.DataFrame(ret)


def convert_ds(ds):
    l = ds.split(',')
    wday = l[0].upper()[:2]
    day = l[1].split('.')[0].strip()
    month = l[1].split(' ')[2]
    hours = [h.strip() for h in l[2].split(' ')]
    return wday, day, month, hours

